impl Solution {
    pub fn max_score(nums: Vec<i32>, x: i32) -> i64 {
        let n = nums.len();
        let mut prefix_sum = vec![0; n + 1];
        for i in 0..n {
            prefix_sum[i + 1] = prefix_sum[i] + nums[i] as i64;
        }
        let mut max_score = 0;
        let mut j = n;
        for i in 0..=n {
            while j > 0 && prefix_sum[i] - prefix_sum[j] > (i as i64 - j as i64) * x as i64 {
                j -= 1;
            }
            if prefix_sum[i] - prefix_sum[j] == (i as i64 - j as i64) * x as i64 {
                max_score = max_score.max(prefix_sum[i] - (i as i64 - j as i64) * x as i64);
            }
        }
        max_score
    }
}
